        public void setIsArrayElement(boolean isArrayElement)
        {
            this.isArrayElement = isArrayElement;
            if (isArrayElement)
            {
                isLeftValue = true;
                isRightValue = false;
                isVar = false;
                isField = false;
            }
            else
            {
                isLeftValue = false;
                isRightValue = true;
            }
        }

        public void setIsField(boolean isField)
        {
            this.isField = isField;
            if (isField)
            {
                isLeftValue = true;
                isRightValue = false;
                isArrayElement = false;
                isVar = false;
            }
            else
            {
                isLeftValue = false;
                isRightValue = true;
            }
        }

        public boolean  isField()
        {
            return isField;
        }

        public boolean isArrayElement()
        {
            return obj.getKind() == Obj.Elem && isLeftValue;
        }

        public boolean isArray()
        {
            return (isLeftValue &&  (obj.getType().getKind() == Struct.Array) );


        }

        public boolean  IsVar()
        {
            return isVar;
        }


        public void generateLeftValue()
        {
        }

        public void generateRightValue()
        {
            if (isArrayElement())
            {
                // a i a[i]
                Code.put(Code.dup_x2);
                // a[i] a i a[i]
                Code.put(Code.pop);
                // a[i] a i
                Code.put(Code.pop);
                // a[i] a
                Code.put(Code.pop);
                // a[i]
                setRightValue(true);
            }
        }

